import { usePushWork } from "../../hooks/usePushWork";
import { useRecordTime } from "../../hooks/useRecoreTime";
import { AddTimeWindow, AddWorkWindow } from "./window/AddWindow";
import { WorkList } from "./WorkList";
import { WorkListTemplate } from "./WorkListTemplate";

export const WorkListComponent = () => {
  const [wakeTime, onClickWakeTime] = useRecordTime("wakeTime");
  const addWakeTimeWindow = (
    <AddTimeWindow onClick={onClickWakeTime} isWake={true} />
  );
  const [bedTime, onClickBedTime] = useRecordTime("bedTime");
  const addBedTimeWindow = (
    <AddTimeWindow onClick={onClickBedTime} isWake={false} />
  );
  const validatorFun = (workObj) => {
    return workObj.workName && workObj.workTime;
  };

  const { workList, onSubmitWork } = usePushWork(validatorFun);
  const addWorkWindow = (
    <AddWorkWindow workList={workList} onSubmitWork={onSubmitWork} />
  );

  //   const workList = JSON.parse(localStorage.getItem("workList"));
  console.log("In worklist, list: ", workList);
  //   const wakeTimeObj = JSON.parse(localStorage.getItem("wakeTime"));
  //   const bedTimeObj = JSON.parse(localStorage.getItem("bedTime"));
  const workListDisplay = (
    <WorkList wakeTime={wakeTime} bedTime={bedTime} workList={workList} />
  );
  return (
    <WorkListTemplate
      addWakeTimeWindow={addWakeTimeWindow}
      addWorkWindow={addWorkWindow}
      workList={workListDisplay}
      addBedTimeWindow={addBedTimeWindow}
    />
  );
};
